import React from "react";
import * as tf from '@tensorflow/tfjs';
//import '@tensorflow/tfjs-react-native';
 
export default class TheMl extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isTfReady: false,
      isModelReady: false,
    };
  }
 
  async componentDidMount() {
    // Wait for tf to be ready.
    await tf.ready();
    // Signal to the app that tensorflow.js can now be used.
    this.setState({
      isTfReady: true,
    });
  }
 
 
  render() {
    //
    return (

        <div>
            {this.state.isTfReady?<p>First Time outputing TFS</p>:<p>hmm</p>}
        </div>

    );
  }
}
